    /**
	 * 
	 */
	private static final long serialVersionUID = 1L;
	private final int radius = 20;
    final DistanceFunction distFn = DistanceFunctionFactory.getDistFnByName("EuclideanDistance"); //CosineDistance
    
	public ArrayList<String> getParas(String document_string){
		String spaces = "[\\s\\r\\n]+";
		Pattern pattern = Pattern.compile(spaces);
		ArrayList<String> paraList = new ArrayList<String>();
		for (String str : document_string.split("\t")) {// \\*\\*\\*
			Matcher matcher = pattern.matcher(str.trim());
			str = matcher.replaceAll(" ");
			if (str.length() >= 1) paraList.add(str);
		}

		return paraList;
	}

	public double getEditDist(String document1_string, String document2_string){
        if ((document1_string == null || document1_string.length() == 0)
                && (document2_string == null || document2_string.length() == 0)) {
                return 0;
            }
            if (document1_string == null || document1_string.length() == 0) {
                return document2_string.length();
            }
            if (document2_string == null || document2_string.length() == 0) {
                return document1_string.length();
            }      
            
            int m = document1_string.length();
            int n = document2_string.length();
            int [][] results = new int [m + 1][n + 1];
            
            int unit_cost = 1;
            int sum_cost = 0;
            for (int i = 0; i <= m; i++) {
                results[i][0] = sum_cost;
                sum_cost += unit_cost;
            }
            sum_cost = 0;
            for (int j = 0; j <= n; j++) {
                results[0][j] = sum_cost;
                sum_cost += unit_cost;
            }           

            for (int i = 1; i <= m; i++) {
                for (int j = 1; j <= n; j++) {
                    if (document1_string.charAt(i - 1) == document2_string.charAt(j - 1)) {
                        results[i][j] = results[i - 1][j - 1];
                    } else {
                        results[i][j] = 
                        1 + Math.min(results[i - 1][j - 1],
                            Math.min(results[i - 1][j], results[i][j - 1])); 
                    }
                }
            }
            return (double)results[m][n];
	}
	public double getPVDTWDist(String document1_string, String document2_string){
		double cost = 0.0;
		TimeSeries tsI, tsJ;
		tsI = new TimeSeries(document1_string.replaceAll("\n", " "));// although there is no \n
		tsJ = new TimeSeries(document2_string.replaceAll("\n", " "));
		cost = com.spark.fastdtw.dtw.DTW.getMyDTWDist(tsI, tsJ, distFn);
		return cost;
	}
	
	public double getDTWDist(String document1_string, String document2_string){


		ArrayList<String> paras_1 = this.getParas(document1_string);		
		ArrayList<String> paras_2 = this.getParas(document2_string);
		
		TimeSeries tsI, tsJ;
		//TimeWarpInfo info;
		double cost = 0.0;
		final int maxI = paras_1.size();
		final int maxJ = paras_2.size();
		//System.out.println("maxI: " + maxI + " maxJ: "+ maxJ);

		final double[][] costMatrix = new double[maxI + 1][maxJ + 1];
		
		// Calculate the values for the first column, from the bottom up.
		costMatrix[0][0] = 0.0;
		
		for (int i = 1; i <= maxI; i++)
		     costMatrix[i][0] = Double.POSITIVE_INFINITY;	
		for (int j = 1; j <= maxJ; j++)
		     costMatrix[0][j] = Double.POSITIVE_INFINITY;
		
		for (int i = 1; i <= maxI; i++)   // i = columns
		{
			// Calculate the value for the bottom row of the current column
			//    (i,0) = LocalCost(i,0) + GlobalCost(i-1,0)
			// para i
			tsI = new TimeSeries(paras_1.get(i-1));
			for (int j = 1; j <= maxJ; j++)  // j = rows
			{
				// para j
				tsJ = new TimeSeries(paras_2.get(j-1));
				
				// fast dtw with window
				//info = com.fastdtw.dtw.FastDTW.getWarpInfoBetween(tsI, tsJ, radius, distFn);  
				// standard DTW

				cost = com.spark.fastdtw.dtw.DTW.getMyDTWDist(tsI, tsJ, distFn);

				//System.out.println("tsI size: " + tsI.size() + " tsJ size: "+ tsJ.size());
				double minLocalCost = Math.min(costMatrix[i-1][j], // insertion
				                                          Math.min(costMatrix[i-1][j-1], // deletion
				                                                   costMatrix[i][j-1])); // match
				costMatrix[i][j] = minLocalCost + cost; //info.getDistance();	
				//System.out.println("minLocalCost: "+ minLocalCost + " cost: " + cost);
				//+ info.getDistance() + " paragraph_i_j dtw: "+costMatrix[i][j]);
			}  // end for loop
		}  // end for loop		
		return costMatrix[maxI][maxJ]; // for normalization use com.spark.fastdtw.dtw.TimeWarpInfo
		
	}// end of getDocumentTree
		
